import React, { useState } from 'react';
import "./PaperTrade.css"
import PortfolioDetails from './PortfolioDetails';
import Portfolio from './PortfolioDetails'


// const portfolio: Portfolio = {
//     name: "Tech Stocks",
//     cash: 100000
// }
interface Stock {
    ticker: string
    price: number
}
interface Portfolio {
    name: string;
    cash: number;
    stocks: [string];
}

function PaperTrade() {
    const [portfolio, setPortfolio] = useState<Portfolio | null>(null)

    const fetchPortfolio = () => setPortfolio({
        name: "Tech Stocks",
        cash: 100000,
        stocks: [Stock]
    });

    return (
        <div className="container">
            <div id="logo">
                <a href="http://localhost:3000/">
                    Paper Trade
                </a>
            </div>
            <button onClick={fetchPortfolio}>Load Portfolio</button>
            {portfolio && <p>{`Your Portfolio: ${portfolio.name}`}</p>}
        </div>
    );
}

export default PaperTrade;
